customStyles.KUP-DATA-TABLE:
#kup-component sticky-header {
display: none;
}

#kup-component kup-paginator {
display: none;
}

:host(.cross-selection) #kup-component table tr.selected td.selected, 
#kup-component table td.selected, #kup-component tr.selected td {
background-color: inherit;
background-image: none;
}

#kup-component table,
#kup-component .below-wrapper {
overflow: hidden !important;
}

:host(.cross-selection) #kup-component tr.selected td:first-of-type,
:host(.cross-selection) #kup-component th.selected { 
box-shadow: none !important;
}

:host(.cross-selection) #kup-component table td.selected,
:host(.cross-selection) #kup-component table tr.selected td {
background-color: inherit;
}

:host(.cross-selection) #kup-component table tr.selected td.fixed-column.selected,
:host(.cross-selection) #kup-component table td.selected.fixed-column, 
:host(.cross-selection) #kup-component table td.selected.fixed-row,
:host(.cross-selection) #kup-component table tr.selected td.fixed-column, 
:host(.cross-selection) #kup-component table tr.selected td.fixed-row {
background-color: inherit;
background-image: none;
}

customStyles.KUP-TREE:
#kup-component .wrapper {
overflow: hidden;
}

#kup-component tr.mdc-ripple-surface::before, 
#kup-component tr.mdc-ripple-surface::after,
#kup-component td.mdc-ripple-surface::before, 
#kup-component td.mdc-ripple-surface::after,
#kup-component .kup-tree__node--selected:not(.kup-tree__node--disabled) td {
background-color: var(--kup-background-color);
}
